import React , { Fragment }from 'react'

const store = [{type:'Roupa'}, {type:'Calçado'}, {type:'Camiseta'}]

function Column() {
    return(<tr>
        <td>Tênis</td>
        <td>Roupa</td></tr>
    )
}

function App () {

    const renderColumns = (element, key) => (<Fragment key={`column-${key}`}><Column></Column></Fragment>)

    return(
        <table>
            {store.map(renderColumns)}
        </table>
    )
}

export default App
